'use strict';

/* header-menu */

$('.header-menu-open').on('click', function(){
	$(this).toggleClass('active');
	$('html').toggleClass('header-menu-open-is-open');
	return false;
})

$(document).on('click', function(event){
	if($(event.target).closest('.header-menu-open, .mobile-panel').length) return;
	$('html').removeClass('header-menu-open-is-open');
	$('.header-menu-open').removeClass('active');
})

/* object-fit img */

function objectFit(img){
	img = $(img);
	img.each(function(){
		var t = $(this),
			src = t.attr('src'),
			position = t.data('position') || 'center center',
			repeat = t.data('repeat') || 'no-repeat',
			size = t.data('size') || 'cover';
		t.parent().css({
			'background':'url('+ src +') ' +  position + ' ' + repeat,
			'background-size': size
		})
	})
}
objectFit('.main-slide>img');

/* sliders */

$('.main-slider').slick({
	accessibility: false,
	useTransform: true,
	arrows: false,
	dots: true,
	speed: 1000,
	autoplay: true,
	autoplaySpeed: 4000,
	pauseOnFocus: false,
	pauseOnHover: false
})

$('.last-news-slider').slick({
	accessibility: false,
	useTransform: true,
	speed: 1000,
	slidesToShow: 2,
	responsive: [
		{
			breakpoint: 1023,
			settings: {
				arrows: false
			}
		},
		{
			breakpoint: 767,
			settings: {
				slidesToShow: 1,
				arrows: false
			}
		}
	]
})

/* circle */

;(function(){
	
	var canvas = document.getElementById('circle-canvas');
	if(!canvas) return;
	
	$('.circle-content').each(function(){
		var t = $(this);
		t.waypoint({
			handler: function(direction){
				if(t.hasClass('is-animate')) return;
				buildCircleElements();
				t.addClass('is-animate');
				setTimeout(drawCircle, 3000);
			},
			offset: '80%'
		})
	})

	$('.circle-list a').on({
		mouseenter: function(){
			var index = $(this).closest('li').data('index');
			$('.circle-info').removeClass('active');
			$('.circle-info[data-index="'+ index +'"]').addClass('active');
		},
		mouseleave: function(){
			$('.circle-info').removeClass('active');
		}
	})

	function buildCircleElements(){
		var elements = $('.circle-list li'),
			elementsNumber = elements.length,
			circleWidth = $('.circle-list').width(),
			animationDelayStatic = 1000 / elementsNumber;
			animationDelay = 0;
			rotation = 270,
			angle = 360 / elementsNumber;
		
		elements.each(function(index){
			var t = $(this),
				background = t.data('background');
			index++;
			$('.circle-load-blocks').append('<div class="circle-info" data-index='+ index +' style="background:'+ background +'"></div>');
			$('.circle-list-wrapp').append('<div class="circle-line"></div>');
			var animationDelayItem = 4 + animationDelay/1000 + 's';
			t.css({
				transform: 'rotate('+ rotation +'deg) translate('+ circleWidth / 2 +'px) rotate(-'+ rotation +'deg)',
				animation: 'opacity-in .2s '+ animationDelayItem  + ' forwards'
			})
			rotation += angle;
			animationDelay += animationDelayStatic;
		})
		
		rotation = 0;
		animationDelay = 0;
		
		$('.circle-line').each(function(){
			var animationDelayItem = 3 + animationDelay/1000 + 's';
			$(this).css({
				transform: 'rotate('+ rotation +'deg)',
				animation: 'opacity-in .2s '+ animationDelayItem + ' forwards'
			})
			rotation += angle;
			animationDelay += animationDelayStatic;
		})
	}
	
	function drawCircle(){
		var context = canvas.getContext('2d'),
			x = canvas.width / 2,
			y = canvas.height / 2,
			radius = canvas.width / 2 - 1,
			endPercent = 100,
			curPerc = 0,
			counterClockwise = false,
			circ = Math.PI * 2,
			quart = Math.PI / 2;

		context.lineWidth = 2;
		context.strokeStyle = '#979797';


		function animate(current){
			context.clearRect(0, 0, canvas.width, canvas.height);
			context.beginPath();
			context.arc(x, y, radius, -(quart), ((circ) * current) - quart, false);
			context.stroke();
			curPerc++;
			if(curPerc < endPercent + 1) {
				requestAnimationFrame(function() {
					 animate(curPerc / 60)
				});
			}
		}

		animate();
	};
	
})();

;(function(){
	var requestAnimationFrame = window.requestAnimationFrame
		|| window.mozRequestAnimationFrame
		|| window.webkitRequestAnimationFrame
		|| window.msRequestAnimationFrame;
	window.requestAnimationFrame = requestAnimationFrame;
})();
 
/* form */

$('.form').on('submit', function() {
	$(this).addClass('active').find('.submit').attr('disabled', true);
	$(this).ajaxSubmit({
		clearForm: true,
		success: success
	});
	return false;
});

function success(data){
	var form = $('.form.active');
	form.find('.submit').removeAttr('disabled');
	form.find('.form-sent').css({
		minHeight: form.find('.form-body').height()
	})
	form.removeClass('active').addClass('is-sent');
}